package ArrayList;

import java.util.ArrayList;

public class foreachLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		ArrayList<String> List = new ArrayList<String>();
		List.add("Ravi");
		List.add("sudha");
		List.add("29");
		
		for(String obj:List)
			System.out.println(obj);

	}

}
